-- ----------------------------
-- Table structure for t_app_user_camera
-- ----------------------------
DROP TABLE IF EXISTS `t_app_user_camera`;
CREATE TABLE `t_app_user_camera`  (
  `id` bigint(20) UNSIGNED NOT NULL COMMENT '关系ID',
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '用户编号',
  `camera_id` bigint(20) UNSIGNED NOT NULL COMMENT '设备编号',
  `group_id` bigint(20) NULL DEFAULT NULL COMMENT '灯所在的群组ID',
  `user_notification` tinyint(1) NULL DEFAULT 0 COMMENT '是否接收推送（0-不推送，1-推送）',
  `qid` char(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '摄像头qId',
  `enable` enum('true','false') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'true' COMMENT '全部设置是否有效（false:否, true:是）',
  `link_type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '用户与ipc的关系：0表示拥有（绑定）关系，1表示install关系',
  `create_date` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `l_upd_date` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_user_camera`(`user_id`, `camera_id`) USING BTREE,
  INDEX `inedx_qid`(`qid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户摄像头关联表' ROW_FORMAT = Compact;

